import React from 'react';
import ReactDOM from 'react-dom';


const Header = (props) => {
  console.log(props)
  return (

    <div>
    <h1>{props.course}</h1>
    </div>
  )
}

const Part = (props) => {
  return(
    <div>
      <p>{props.part} {props.exercises}</p>
    </div>
  )
}

const Course = (props) => {
  return(
    <div>
    <Part part = {props.parts[0].name} exercises = {props.parts[0].exercises}></Part>
    <Part part = {props.parts[1].name} exercises={props.parts[1].exercises}></Part>
    <Part part = {props.parts[2].name} exercises={props.parts[2].exercises}></Part>
    </div>
  )
}

const Total = (props) => {
  return (
   <div>
     <p>Number of exercises: {props.parts[0] + props.parts[1] + props.parts[2]}</p>
   </div> 
  )
}

const App = () => {
  const course = 'Half Stack application development'
  const parts = [
    {
      name: 'Fundamentals of React',
      exercises: 10
    },
    {
      name: 'Using props to pass data',
      exercises: 7
    },
    {
      name: 'State of a component',
      exercises: 14
    }
  ]

  return (
    <div>
      <Header course = {course}></Header>
      <Course parts = {parts} ></Course>
      <Total parts = {parts}></Total>
    </div>



  )
}

ReactDOM.render(<App />, document.getElementById('root'))
